                EndWriteAttribute();
                WriteLiteral("><source srcset=\"https://images.ctfassets.net/vhjvyfr5klfu/1p7npJSMQOI6F068PoeGhc/774286b18abaaf3f15b98402ea9dd2cd/Monica_3.jpg?q=50&amp;fm=jpg&amp;w=640&amp;h=480\"");
