                WriteLiteral("><img alt=\"MonicaLindstedt\" class=\"_15krI\"></picture></div><div class=\"_1w_TW\" style=\"display: none;\"><div");
                BeginWriteAttribute("class", " class=\"", 425375, "\"", 425383, 0);
                EndWriteAttribute();
                WriteLiteral(@"><div class=""_3Aktc"" style=""background: url(&quot;https://images.ctfassets.net/vhjvyfr5klfu/1p7npJSMQOI6F068PoeGhc/774286b18abaaf3f15b98402ea9dd2cd/Monica_3.jpg?q=50&amp;fm=jpg&amp;w=640&amp;h=480&quot;) center center / cover no-repeat;""></div></div></div></div><div class=""_26DYW""><h3 class=""_1S11V"">Vision och värderingar</h3><p class=""kF6y1"">Vår vision är enkel, vi vill skapa mer hemfrid. Med hushållsnära tjänster underlättar vi vardagen för våra kunder och gör livet hemma lite enklare. </p></div></a></li>
                        <li class=""_3KSkX""><a class=""_1PJbx"" href=""/karriar/moet-marcia-eunice""><div class=""_3o3Nd""><div class=""_37N3B""><picture><source type=""image/webp"" srcset=""https://images.ctfassets.net/vhjvyfr5klfu/3W3oXBxXpUMobjwpLN6Rda/27d0e69308cd390886547d17191be9de/Marcia_Eunice.jpg?q=40&amp;fm=webp&amp;w=640&amp;h=480""");
