                WriteLiteral("><source srcset=\"https://images.ctfassets.net/vhjvyfr5klfu/3W3oXBxXpUMobjwpLN6Rda/27d0e69308cd390886547d17191be9de/Marcia_Eunice.jpg?q=50&amp;fm=jpg&amp;w=640&amp;h=480\"");
