                EndWriteAttribute();
                WriteLiteral("><img alt=\"Marcia Eunice\" class=\"_15krI\"></picture></div><div class=\"_1w_TW\" style=\"display: none;\"><div");
                BeginWriteAttribute("class", " class=\"", 426521, "\"", 426529, 0);
                EndWriteAttribute();
                WriteLiteral(@"><div class=""_3Aktc"" style=""background: url(&quot;https://images.ctfassets.net/vhjvyfr5klfu/3W3oXBxXpUMobjwpLN6Rda/27d0e69308cd390886547d17191be9de/Marcia_Eunice.jpg?q=50&amp;fm=jpg&amp;w=640&amp;h=480&quot;) center center / cover no-repeat;""></div></div></div></div><div class=""_26DYW""><h3 class=""_1S11V"">Möt Marcia Eunice</h3><p class=""kF6y1"">”Jag började som Hemfridare, sedan blev jag handledare och fick introducera nya kollegor in i yrket – idag leder jag ett serviceteam.”</p></div></a></li>
                        <li class=""_3KSkX""><a class=""_1PJbx"" href=""/hallbarhet/hemfrids-stadprodukter""><div class=""_3o3Nd""><div class=""_37N3B""><picture><source type=""image/webp"" srcset=""https://images.ctfassets.net/vhjvyfr5klfu/6jTxSBx9OEGw0YuAiy62wK/4a1200d2f6fa9633cefff1e5fc40bf6a/hemfrids_egna_reng_ringsmedel.jpg?q=40&amp;fm=webp&amp;w=640&amp;h=480""");
