                EndWriteAttribute();
                WriteLiteral("><img alt=\"hemfrids egna rengöringsmedel\" class=\"_15krI\"></picture></div><div class=\"_1w_TW\" style=\"display: none;\"><div");
                BeginWriteAttribute("class", " class=\"", 427708, "\"", 427716, 0);
                EndWriteAttribute();
                WriteLiteral(@"><div class=""_3Aktc"" style=""background: url(&quot;https://images.ctfassets.net/vhjvyfr5klfu/6jTxSBx9OEGw0YuAiy62wK/4a1200d2f6fa9633cefff1e5fc40bf6a/hemfrids_egna_reng_ringsmedel.jpg?q=50&amp;fm=jpg&amp;w=640&amp;h=480&quot;) center center / cover no-repeat;""></div></div></div></div><div class=""_26DYW""><h3 class=""_1S11V"">Hemfrids egna städprodukter</h3><p class=""kF6y1"">Vi vill att det ska vara enkelt att ta hand om hemmet på ett miljövänligt sätt. Därför har vi tagit fram egna städprodukter märkta med Bra Miljöval.</p></div></a></li>
                        <li class=""_3KSkX"">
                            <a class=""_1PJbx"" href=""/karriar/moet-alexander-zubieta"">
                                <div class=""_3o3Nd""><div");
                BeginWriteAttribute("class", " class=\"", 428445, "\"", 428453, 0);
                EndWriteAttribute();
                WriteLiteral(@"></div></div><div class=""_26DYW"">
                                    <h3 class=""_1S11V"">Möt Alexander Zubieta</h3><p class=""kF6y1"">
                                        ”För mig är det viktigt att det är seriöst företag som erbjuder trygghet. Att företaget tar hand om sina anställda och har bra villkor med kollektivavtal och vidareutbildningar.”
                                    </p>
                                </div>
                            </a>
                        </li>
                        <li class=""_3KSkX""><a class=""_1PJbx"" href=""/karriar/swedish-fika""><div class=""_3o3Nd""><div");
                BeginWriteAttribute("class", " class=\"", 429070, "\"", 429078, 0);
                EndWriteAttribute();
                WriteLiteral(@"></div></div><div class=""_26DYW""><h3 class=""_1S11V"">Swedish Fika</h3><p class=""kF6y1"">Swedish Fika, vårt språkcafé, är tillfället då våra kunder och våra Hemfridare har möjlighet att träffa varandra och öva svenska tillsammans.</p></div></a></li>
                        <li class=""_3KSkX""><a class=""_1PJbx"" href=""/karriar/mot-david""><div class=""_3o3Nd""><div");
                BeginWriteAttribute("class", " class=\"", 429438, "\"", 429446, 0);
                EndWriteAttribute();
                WriteLiteral(@"></div></div><div class=""_26DYW""><h3 class=""_1S11V"">Möt David</h3><p class=""kF6y1"">Varje dag jobbar vi med att skapa en enklare och mer friktionsfri vardag för våra kunder. Träffa några av våra chefer för att få en bättre förståelse för hur det är att vara en del av Hemfrid. </p></div></a></li>
                        <li class=""_3KSkX""><a class=""_1PJbx"" href=""/karriar/mot-anna""><div class=""_3o3Nd""><div");
                BeginWriteAttribute("class", " class=\"", 429854, "\"", 429862, 0);
                EndWriteAttribute();
                WriteLiteral(@"></div></div><div class=""_26DYW""><h3 class=""_1S11V"">Vi är Hemfrid</h3><p class=""kF6y1"">Vi är nästan 2 300 engagerade medarbetare på Hemfrid. Det som förenar oss är drivet och viljan att göra vardagen enklare för våra kunder.</p></div></a></li>
